import React from "react"; 
import { Link } from "react-router-dom";
import landingPa from "./langinPa.module.css";

function landingPage() {
    return <div>
    
    <header>
        <nav>
            <div class="logo">
                <img src="./images/check-p.png" alt="" />
            </div>
            <div class="links">
                <a href="/" class="btn btn-login">Log In</a>
                <a href="/" class="btn btn-register hide-for-mobile ">Get started</a>
            </div>
        </nav>
    </header>

    </div>
}
export default landingPage;
